/* These are global values, used for alignment.  Previously for
   trimming, treated query N's as mismatches, but this is not correct
   for query N's in the middle of the read.  Also, trimming query N's
   can affect the --clip-overlap feature. */
static bool query_unk_mismatch_p = false;
static bool genome_unk_mismatch_p = true;


static Genomecomp_T
block_diff_standard (Genomecomp_T *query_shifted, Genomecomp_T *nts_ptr, Genomecomp_T *ref_ptr,
		     bool plusp, int genestrand, bool query_unk_mismatch_local_p) {
  Genomecomp_T diff;

  debug(printf("Comparing high: query %08X with genome %08X ",query_shifted[0],nts_ptr[0]));
  debug(printf("Comparing low: query %08X with genome %08X ",query_shifted[1],nts_ptr[1]));

#ifdef WORDS_BIGENDIAN
  diff = (query_shifted[0] ^ Bigendian_convert_uint(nts_ptr[0])) | (query_shifted[1] ^ Bigendian_convert_uint(nts_ptr[1]));
#else
  diff = (query_shifted[0] ^ nts_ptr[0]) | (query_shifted[1] ^ nts_ptr[1]);
#endif

  /* Query Ns */
  if (query_unk_mismatch_local_p) {
    /* Query: Considering N as a mismatch */
    diff |= query_shifted[2];
  } else {
    /* Query: Considering N as a wildcard */
    diff &= ~(query_shifted[2]);
  }

  /* Genome Ns */
  if (genome_unk_mismatch_p) {
    /* Genome: Considering N as a mismatch */
#ifdef WORDS_BIGENDIAN
    diff |= Bigendian_convert_uint(ref_ptr[2]);
#else
    diff |= ref_ptr[2];
#endif
  } else {
    /* Genome: Considering N as a wildcard */
#ifdef WORDS_BIGENDIAN
    diff &= ~(Bigendian_convert_uint(ref_ptr[2]));
#else
    diff &= ~(ref_ptr[2]);
#endif
  }

  debug(printf(" => diff %08X\n",diff));

  return diff;
}


#ifdef HAVE_64_BIT
static inline void
nt_unshuffle (UINT4 *highbits, UINT4 *lowbits, UINT4 high, UINT4 low) {
  UINT8 x, t;

  x = (UINT8) high;
  x <<= 32;
  x |= low;

  t = (x ^ (x >> 1))  & 0x2222222222222222;  x = x ^ t ^ (t << 1);
  t = (x ^ (x >> 2))  & 0x0C0C0C0C0C0C0C0C;  x = x ^ t ^ (t << 2);
  t = (x ^ (x >> 4))  & 0x00F000F000F000F0;  x = x ^ t ^ (t << 4);
  t = (x ^ (x >> 8))  & 0x0000FF000000FF00;  x = x ^ t ^ (t << 8);
  t = (x ^ (x >> 16)) & 0x00000000FFFF0000;  x = x ^ t ^ (t << 16);

  *highbits = (UINT4) (x >> 32);
  *lowbits = (UINT4) x;

  return;
}

#else

static inline void
nt_unshuffle (UINT4 *highbits, UINT4 *lowbits, UINT4 high, UINT4 low) {
  UINT4 t;

  /* unshuffle high */
  t = (high ^ (high >> 1)) & 0x22222222;  high = high ^ t ^ (t << 1);
  t = (high ^ (high >> 2)) & 0x0C0C0C0C;  high = high ^ t ^ (t << 2);
  t = (high ^ (high >> 4)) & 0x00F000F0;  high = high ^ t ^ (t << 4);
  t = (high ^ (high >> 8)) & 0x0000FF00;  high = high ^ t ^ (t << 8);

  /* unshuffle low */
  t = (low ^ (low >> 1)) & 0x22222222;  low = low ^ t ^ (t << 1);
  t = (low ^ (low >> 2)) & 0x0C0C0C0C;  low = low ^ t ^ (t << 2);
  t = (low ^ (low >> 4)) & 0x00F000F0;  low = low ^ t ^ (t << 4);
  t = (low ^ (low >> 8)) & 0x0000FF00;  low = low ^ t ^ (t << 8);

  *highbits = (high & 0xFFFF0000) | (low >> 16);
  *lowbits = (high << 16) | (low & 0x0000FFFF);

  return;
}
#endif

/* For backward compatibility, when the genomebits file is not available */
static Genomecomp_T
block_diff_standard_comp (Genomecomp_T *query_shifted, Genomecomp_T *nts_ptr, Genomecomp_T *ref_ptr,
			  bool plusp, int genestrand, bool query_unk_mismatch_local_p) {
  Genomecomp_T diff, highbits, lowbits;

#ifdef WORDS_BIGENDIAN
  nt_unshuffle(&highbits,&lowbits,Bigendian_convert_uint(nts_ptr[0]),Bigendian_convert_uint(nts_ptr[1]));
#else
  nt_unshuffle(&highbits,&lowbits,nts_ptr[0],nts_ptr[1]);
#endif

  debug(printf("Comparing high: query %08X with genome %08X ",query_shifted[0],highbits));
  debug(printf("Comparing low: query %08X with genome %08X ",query_shifted[1],lowbits));

  diff = (query_shifted[0] ^ highbits) | (query_shifted[1] ^ lowbits);

  /* Query Ns */
  if (query_unk_mismatch_local_p) {
    /* Query: Considering N as a mismatch */
    diff |= query_shifted[2];
  } else {
    /* Query: Considering N as a wildcard */
    diff &= ~(query_shifted[2]);
  }

  /* Genome Ns */
  if (genome_unk_mismatch_p) {
    /* Genome: Considering N as a mismatch */
#ifdef WORDS_BIGENDIAN
    diff |= Bigendian_convert_uint(ref_ptr[2]);
#else
    diff |= ref_ptr[2];
#endif
  } else {
    /* Genome: Considering N as a wildcard */
#ifdef WORDS_BIGENDIAN
    diff &= ~(Bigendian_convert_uint(ref_ptr[2]));
#else
    diff &= ~(ref_ptr[2]);
#endif
  }

  debug(printf(" => diff %08X\n",diff));

  return diff;
}




/* wildcard if ref == alt && ref_flag == 0 && alt_flag == 1 */
/* not wildcard if ref != alt || ref_flag == 1 || alt_flag == 0 */
/* diffs are (query ^ ref) & (query ^ alt) & ~wildcard */
/* nts_ptr here is alt_ptr */
static Genomecomp_T
block_diff_standard_wildcard (Genomecomp_T *query_shifted, Genomecomp_T *nts_ptr, Genomecomp_T *ref_ptr,
			      bool plusp, int genestrand, bool query_unk_mismatch_local_p) {
  Genomecomp_T diff, non_wildcard;

  /* Taken from block_diff_standard */
  diff = (query_shifted[0] ^ nts_ptr[0]) | (query_shifted[1] ^ nts_ptr[1]);

  /* Query Ns */
  if (query_unk_mismatch_local_p) {
    /* Query: Considering N as a mismatch */
    diff |= query_shifted[2];
  } else {
    /* Query: Considering N as a wildcard */
    diff &= ~(query_shifted[2]);
  }

  /* Genome Ns */
  if (genome_unk_mismatch_p) {
    /* Genome: Considering N as a mismatch */
#ifdef WORDS_BIGENDIAN
    diff |= Bigendian_convert_uint(ref_ptr[2]);
#else
    diff |= ref_ptr[2];
#endif
  } else {
    /* Genome: Considering N as a wildcard */
#ifdef WORDS_BIGENDIAN
    diff &= ~(Bigendian_convert_uint(ref_ptr[2]));
#else
    diff &= ~(ref_ptr[2]);
#endif
  }


  /* Test for equality of ref and alt */
  debug(printf("Equality high: ref genome %08X with alt genome %08X ",ref_ptr[0],nts_ptr[0]));
#ifdef WORDS_BIGENDIAN
  non_wildcard = (Bigendian_convert_uint(ref_ptr[0]) ^ Bigendian_convert_uint(nts_ptr[0])) |
    (Bigendian_convert_uint(ref_ptr[1]) ^ Bigendian_convert_uint(nts_ptr[1]));
#else
  non_wildcard = (ref_ptr[0] ^ nts_ptr[0]) | (ref_ptr[1] ^ nts_ptr[1]);
#endif
  debug(printf(" => diff %08X\n",non_wildcard));
  
  /* Ref flags */
  debug(printf("Wildcard add ref flags: ref genome %08X and alt genome %08X ",ref_ptr[2],nts_ptr[2]));
#ifdef WORDS_BIGENDIAN
  non_wildcard |= Bigendian_convert_uint(ref_ptr[2]);
#else
  non_wildcard |= ref_ptr[2];
#endif

  /* Alt flags */
  debug(printf("Wildcard add alt flags: ref genome %08X and alt genome %08X ",ref_ptr[2],nts_ptr[2]));
#ifdef WORDS_BIGENDIAN
  non_wildcard |= ~(Bigendian_convert_uint(nts_ptr[2]));
#else
  non_wildcard |= ~(nts_ptr[2]);
#endif
  debug(printf(" => non_wildcard %08X\n",non_wildcard));

  return diff & non_wildcard;
}


static Genomecomp_T
block_diff_standard_wildcard_comp (Genomecomp_T *query_shifted, Genomecomp_T *nts_ptr, Genomecomp_T *ref_ptr,
				   bool plusp, int genestrand, bool query_unk_mismatch_local_p) {
  Genomecomp_T diff, non_wildcard, nts_highbits, nts_lowbits, ref_highbits, ref_lowbits;


#ifdef WORDS_BIGENDIAN
  nt_unshuffle(&nts_highbits,&nts_lowbits,Bigendian_convert_uint(nts_ptr[0]),Bigendian_convert_uint(nts_ptr[1]));
#else
  nt_unshuffle(&nts_highbits,&nts_lowbits,nts_ptr[0],nts_ptr[1]);
#endif

  /* Taken from block_diff_standard */
  diff = (query_shifted[0] ^ nts_highbits) | (query_shifted[1] ^ nts_lowbits);

  /* Query Ns */
  if (query_unk_mismatch_local_p) {
    /* Query: Considering N as a mismatch */
    diff |= query_shifted[2];
  } else {
    /* Query: Considering N as a wildcard */
    diff &= ~(query_shifted[2]);
  }

  /* Genome Ns */
  if (genome_unk_mismatch_p) {
    /* Genome: Considering N as a mismatch */
#ifdef WORDS_BIGENDIAN
    diff |= Bigendian_convert_uint(ref_ptr[2]);
#else
    diff |= ref_ptr[2];
#endif
  } else {
    /* Genome: Considering N as a wildcard */
#ifdef WORDS_BIGENDIAN
    diff &= ~(Bigendian_convert_uint(ref_ptr[2]));
#else
    diff &= ~(ref_ptr[2]);
#endif
  }


#ifdef WORDS_BIGENDIAN
  nt_unshuffle(&ref_highbits,&ref_lowbits,Bigendian_convert_uint(ref_ptr[0]),Bigendian_convert_uint(ref_ptr[1]));
#else
  nt_unshuffle(&ref_highbits,&ref_lowbits,ref_ptr[0],ref_ptr[1]);
#endif

  /* Test for equality of ref and alt */
  debug(printf("Equality high: ref genome %08X with alt genome %08X ",ref_ptr[0],nts_ptr[0]));
  non_wildcard = (ref_highbits ^ nts_highbits) | (ref_lowbits ^ nts_lowbits);
  debug(printf(" => diff %08X\n",non_wildcard));
  
  /* Ref flags */
  debug(printf("Wildcard add ref flags: ref genome %08X and alt genome %08X ",ref_ptr[2],nts_ptr[2]));
#ifdef WORDS_BIGENDIAN
  non_wildcard |= Bigendian_convert_uint(ref_ptr[2]);
#else
  non_wildcard |= ref_ptr[2];
#endif

  /* Alt flags */
  debug(printf("Wildcard add alt flags: ref genome %08X and alt genome %08X ",ref_ptr[2],nts_ptr[2]));
#ifdef WORDS_BIGENDIAN
  non_wildcard |= ~(Bigendian_convert_uint(nts_ptr[2]));
#else
  non_wildcard |= ~(nts_ptr[2]);
#endif
  debug(printf(" => non_wildcard %08X\n",non_wildcard));

  return diff & non_wildcard;
}


