    case CMET_STRANDED: block_diff = block_diff_cmet_stranded_comp; break;
    case CMET_NONSTRANDED: block_diff = block_diff_cmet_nonstranded_comp; break;
    case ATOI_STRANDED: block_diff = block_diff_atoi_stranded_comp; break;
    case ATOI_NONSTRANDED: block_diff = block_diff_atoi_nonstranded_comp; break;
